import React from 'react'



function AddCard({studyDeck}){
  let result
  if(studyDeck!==undefined){
    result=(
      <div className={"container"}>
        <div className={"row"}>
          <h4 className={"col-12"}>You need atleast 3 cards. You have {studyDeck.cards.length} cards.</h4>
          <button className={"btn btn-danger col-1"}>Add Card</button>
        </div>
      </div>
      )
  }
  return result;
}


export default AddCard;
